import './Header.css'
import Image from '../../../Data/Arrow2.svg'

const Header = () => {
    return (
        <header className={'Header'}>
            <img src={Image} height={'58'} width={'54'}/>
            <h1 id={'Title'}>와플고등학교 명단 관리 프로그램</h1>
        </header>
    )
}

export default Header
